script: |
  super -f text -I q8688.spq | sort > q8688.out

inputs:
  - name: q8688.spq
    data: |
      SELECT - col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 + col0 * - - col1 * - 60 * - col0 + + ( col1 ) IS NULL;
  - name: tab2

outputs:
  - name: q8688.out
    data: |
      -51
      -67
      -77
